import React, { useState, useEffect } from "react";
import "./DocNavbar.css";
import Logo from "../../images/logo.png";
import Data from "../../data"; // Patient data
import PatientCard from "./PatientCard";
import { useNavigate } from "react-router-dom";

export default function DoctorNavbar() {
  const navigate = useNavigate();
  const [text, setText] = useState("");
  const [searchResults, setSearchResults] = useState([]);
  const [submittedResults, setSubmittedResults] = useState([]);

  useEffect(() => {
    window.history.replaceState(null, null, "/");
  }, []);

  const handleInputChange = (event) => {
    const searchQuery = event.target.value;
    setText(searchQuery);

    if (searchQuery.trim() === "") {
      setSearchResults([]);
      return;
    }

    const filteredResults = Data.filter((patient) =>
      patient.name.toLowerCase().includes(searchQuery.toLowerCase())
    );
    setSearchResults(filteredResults);
  };

  const handleLogOut = () => {
    navigate("/");
  };

  const handleOnSubmit = (event) => {
    event.preventDefault();
    if (text.trim() === "") {
      setSubmittedResults([]);
      return;
    }

    const filteredResults = Data.filter((patient) =>
      patient.name.toLowerCase().includes(text.toLowerCase())
    );
    setSubmittedResults(filteredResults);
  };

  // Extracting initials (You can replace this with doctor’s name from localStorage or props)
  const doctorName = "Dr. Smith";
  const initials = doctorName
    .split(" ")
    .map((n) => n[0])
    .join("");

  return (
    <div>
      <nav className="navbar d-flex align-items-center justify-content-between px-4" style={{ backgroundColor: "#f8f9fa", height: "70px", borderBottom: "1px solid #dee2e6" }}>
        {/* Logo */}
        <div className="d-flex align-items-center">
          <img src={Logo} alt="Logo" style={{ width: "60px" }} />
        </div>

        {/* Search */}
        <form className="d-flex align-items-center" role="search" onSubmit={handleOnSubmit}>
          <input
            className="form-control me-2"
            type="search"
            placeholder="Patient Name"
            aria-label="Search"
            value={text}
            onChange={handleInputChange}
            style={{ minWidth: "200px" }}
          />
          <button className="btn btn-primary" type="submit">
            Submit
          </button>
        </form>

        {/* Avatar / Initials Dropdown */}
        <div className="dropdown">
          <div
            className="btn btn-secondary dropdown-toggle "
            role="button"
            data-bs-toggle="dropdown"
            aria-expanded="false"
          >
            {initials}
          </div>
          <ul className="dropdown-menu dropdown-menu-end">
            <li>
              <button className="dropdown-item" onClick={handleLogOut}>
                Log out
              </button>
            </li>
          </ul>
        </div>
      </nav>

      {/* Search Results */}
      <div className="search-results">
        {searchResults.length > 0 ? (
          searchResults.map((patient, index) => (
            <PatientCard
              key={index}
              name={patient.name}
              contact={patient.contact}
              email={patient.email}
              gender={patient.gender}
            />
          ))
        ) : text ? (
          <div className="mt-5 mx-5" style={{ color: "#5f6466" }}>
            <p>No Patient Found</p>
          </div>
        ) : null}
      </div>
    </div>
  );
}
